INSERT INTO `mfp_classes` VALUES (38,'GO','Общее назначение','Для детей','Дети любят рисовать на компьютере, и наиболее интересные произведения достойны перевода на бумагу, например, как подарок бабушке.\n\n<strong>Рекомендуемые категории продуктов:</strong>\nНедорогой цветной струйник (примерно, до 8 тыс. руб.).\nЕсли для рисования используется планшет, желательно, чтобы принтер поддерживал Wi-Fi.\n\nЕсли рисунков много, то выгоднее будет приобрести несколько более дорогой принтер (до 10–12 тыс. руб) с бОльшими контейнерами для чернил.','1 Для детей'),(41,'GO','Фото','Для печати фото (любительский)','Цветной струйник А4 для печати фото, ценой $100-$400, без факса','4 Для любителей цифрового фото'),(42,'GO','Фото','Для печати фото (профессиональный)','Цветной струйник А3, 6+ цветов','5 Для профессионалов цифрового фото'),(43,'GO','Коммерческий','Для офиса с умеренной печатью','Ч/Б принтер/МФУ 24-45 стр/мин ценой до $1000 или цветной лазерный принтер 20-30 стр/мин или струйник с СНПЧ $100-$500','7 Для офиса с умеренной печатью '),(44,'GO','Коммерческий','Для офиса с интенсивной печатью','Ч/б принтер/МФУ 40+ стр/мин или цветной лазерный принтер 30+ стр/мин или быстрый струйник','8 Для офиса с интенсивной печатью'),(45,'CL','Тип аппарата','Принтер','Только принтер','1 Принтеры'),(46,'CL','Тип аппарата','Настольный МФУ','Многофункциональное устройство формата A4','2 Настольные МФУ А4'),(47,'CL','Технология печати','Лазерный','','3 Лазерные'),(48,'CL','Технология печати','Струйный','','4 Струйные'),(49,'CL','Цвет','Черно-белый','','5 Монохромные'),(50,'CL','Цвет','Цветной','','6 Цветные'),(51,'CL','Коммуникации','Wi-Fi','Возможность беспроводного подключения','7 Наличие Wi-Fi'),(52,'CL','','Высокопроизводительный','Высокая скорость печати','8 Высокопроизводительные'),(53,'GO','Общее назначение','Для учащихся','Школьники и студенты могут распечатывать материалы из Сети, копировать или оцифровывать конспекты, квитанции, справки и т.д.\n\n<strong>Рекомендуемые категории продуктов:</strong>\nЛучше всего для этого подходят недорогие черно/белые лазерные МФУ. \nЕсли печатать/копировать часто и много, подойдут монохромные струйные МФУ. \nЕсли только печатать – дешевле обойдутся черно/белые принтеры. \nСкорость печати - до 30 стр/мин.','2 Для школьников и студентов'),(54,'GO','Общее назначение','Для домашних дел','Cтруйник или ч/б-лазерник МФУ, 20-30 стр/мин, до 300 стр/мес, ценой до $200','3 Для домашних дел');
