INSERT INTO `txt_ratings` VALUES (1,'<p>&nbsp;</p>\r\n\r\n<h2>Рейтинг самых продаваемых Игровых моделей ноутбуков</h2>\r\n\r\n<p><em>По данным аналитической компании&nbsp;<a href=\"http://www.itbestsellers.ru/\">ITRsearch</a>:</em></p>\r\n\r\n<h3>Апрель 2021.</h3>\r\n\r\n<p>(Список отсортирован по возрастанию рублевых цен.)</p>\r\n\r\n<div class=\"in_article_warning\">\r\n<p><span style=\"font-size:18px\"><strong>⚠</strong> </span>Приведены средние розничные цены на середину апреля. Средняя цена включает стоимость&nbsp;всех возможных конфигураций базовой модели. Учитывая, что большинство игровых ноутбуков включает множество возможных комплектаций. Соответственно,&nbsp;и их ценовой уровень имеет очень большое расхождение от средней. Модель обозначенная ниже по цене, допустим 75 тыс, руб, на самом деле может включать минимальную конфигурацию ценой от 50 тыс. и до максимальной - более 100 тыс.</p>\r\n</div>\r\n\r\n<div class=\"inarticle_table_wrap\">\r\n<table class=\"inarticle_table\">\r\n	<thead>\r\n		<tr>\r\n			<td><a href=\"https://allgid.ru/Nb/4103\">MSI&nbsp;MSI GF63C</a></td>\r\n			<td><strong>69&nbsp;920</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1050, GTX1050 Ti</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://allgid.ru/Nb/4419\">Lenovo&nbsp;IdeaPad Gaming 3 15ARH05</a></td>\r\n			<td><strong>73&nbsp;461</strong></td>\r\n			<td>AMD</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://allgid.ru/Nb/4339\">HP&nbsp;Pavilion 15-ec1000</a></td>\r\n			<td><strong>73&nbsp;469</strong></td>\r\n			<td>AMD</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://allgid.ru/Nb/4655\">Asus&nbsp;Asus FX506L</a></td>\r\n			<td><strong>74&nbsp;716</strong></td>\r\n			<td>Intel</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n		<tr>\r\n			<td><a href=\"https://allgid.ru/Nb/2700\">Acer&nbsp;Aspire AN515-44</a></td>\r\n			<td><strong>75&nbsp;523</strong></td>\r\n			<td>AMD</td>\r\n			<td>GTX1650</td>\r\n			<td>15</td>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n	</tbody>\r\n</table>\r\n</div>','Самые продаваемые модели Игровых ноутбуков (Апрель)','Игровые ноутбуки. Выбрать хороший игровой ноутбук. Модели-Бестселлеры. Цены, характеристики.','<div class=\"article-right-link\"><a href=\"/Nb/?GO_Game=Yes&amp;tabs=marketability\">Фильтр по всем доступным моделям ноутбуков </a>\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\">&nbsp;</div>\r\nИгровой</div>\r\n</div>\r\n\r\n<h3><a href=\"http://127.0.0.1:8000/how/Nb/1\" target=\"_blank\">Ноутбук для программиста</a></h3>\r\n\r\n<p><a href=\"http://127.0.0.1:8000/how/Nb/1\" target=\"_blank\">На какие характеристики ноутбука ориентироваться в зависимости.</a>..</p>\r\n\r\n<h3><a href=\"http://127.0.0.1:8000/how/Nb/3\" target=\"_blank\">Ноутбуки с логотипом Intel EVO - что это значит?</a></h3>\r\n\r\n<p><a href=\"http://127.0.0.1:8000/how/Nb/3\" target=\"_blank\">В реальности Evo специфицирует огромное количество разнообразных параметров, о существовании которых обычный пользователь даже не догадывается, но...</a></p>','Nb','В Апреле 2021 г. cамой популярной моделью на российских прилавках весной этого года стала Lenovo IdeaPad Gaming 3 15ARH05.\r\nНоутбук базируется на процессорах AMD Ryzen серии 4000U (Renior) и бюджетных видеокартах NVidia GTX 1650.\r\nВ числе других победителей зачета встречаются и более навороченные варианты.','2021-07-06','/static/marketability/pict/rate/len_ip3_15ARH05.jpg',0);
